import React, {useState, useEffect} from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css'

import Styling from '../styling/Styling'

import FoodsDisplay from '../components/Meals/FoodsDisplay'
import Breakfast from '../components/Meals/Breakfast'
import Lunch from '../components/Meals/Lunch'
import Dinner from '../components/Meals/Dinner'

import SearchIcon from '@material-ui/icons/Search';
import {InputBase, Toolbar, TextField, Button} from "@material-ui/core"
const Authorization = ({user}) => {

  const[date, setDate] =useState(new Date())
  const [foods,setFoods] = useState([])
  const [search, setSearch] = useState("")
  const [selectedFood, setSelectedFood] = useState("")
  const [meal,setMeal] = useState("")
  const [quantity, setQuantity] = useState(1)
  const [food_id, setFoodId] = useState(null)

  const onChange = () => {
    setDate(date)
  }

  const handleChange = (event) => {
    setSearch(event.target.value)
  }

  const handleAdd = () => {

  }
  const filterLog =(meal) => user.user_foods ? user.user_foods.filter(food => food.meal === meal) : []



  useEffect(() => {
    fetch("http://localhost:3000/foods")
    .then(res => res.json())
    .then(setFoods)
  },[])


  const searchFoods = () => search ?  foods.filter(food => food.name.toLowerCase().includes(search.toLowerCase())) : []



  return (
    <header className={"App-page"}>
      <h6> {selectedFood ? selectedFood : "Remember always keep track your eating"}</h6>
       <h1>Food Log</h1>
        <div className='rowC'>
            <div className="container-1">
              <h1>Calendar</h1>
              <Calendar className="calendar" onChange={onChange} value={date} />
            </div>
            <div className='container-2' >
              <Toolbar>
                  <div className={Styling().search}>
                    <div className={Styling().searchIcon}>
                      <SearchIcon />
                    </div>
                    <InputBase
                      onChange={handleChange}
                      placeholder="   Search.."
                      classes={{
                        root: Styling().inputRoot,
                        input: Styling().inputInput,
                      }}
                      inputProps={{ 'aria-label': 'search' }}
                      />
                  </div>
                  <div className={Styling().authBox}>
                       <label >For </label>
                    <select name="cars" id="cars">
                        <option value="null"></option>
                        <option value="breakfast">Breakfast</option>
                        <option value="lunch">Lunch</option>
                        <option value="dinner">Dinner</option>
                    </select>
                  </div>
                  <div className={Styling().authBox}>
                    <label >Quantity </label>
                    <input type="number" name="name"></input>
                  </div>
                  <div className={Styling().authBox}>
                    <Button variant="outlined" size="small" onClick={handleAdd}>
                        Add
                    </Button>
                  </div>

                </Toolbar>
                  <div className='rowC'>
                    <div>
                      <div className='s-meal'><Breakfast user_foods={filterLog("breakfast")}/></div>
                      <div className='s-meal'><Lunch user_foods={filterLog("lunch")}/></div>
                      <div className='s-meal'><Dinner user_foods={filterLog("dinner")}/></div>
                    </div>
                    <div className='display-foods'>
                      <FoodsDisplay foods={searchFoods()} setSelectedFood={setSelectedFood}/>
                    </div>
                  </div>
            </div>
        </div>
    </header>

  )
}



export default Authorization;
